import React, { Component } from 'react';
import './App.css';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem } from 'reactstrap';

class App extends Component {
    constructor(props) {
        super(props);

        this.toggle = this.toggle.bind(this);
        this.state = {
            isOpen: false
        };
    }
    toggle() {
        this.setState({
            isOpen: !this.state.isOpen
        });
    }
  render() {
    return (
        <div>
            <Navbar color="light" light expand="md">
                <NavbarBrand href="/">DIY Drone</NavbarBrand>
                <NavbarToggler onClick={this.toggle} />
                <Collapse isOpen={this.state.isOpen} navbar>
                    <Nav className="ml-auto" navbar>
                        <NavItem>
                            <NavLink href="/">견적</NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink href="/">자유게시판</NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink href="/">QnA게시판</NavLink>
                        </NavItem>
                        <UncontrolledDropdown nav inNavbar>
                            <DropdownToggle nav caret>
                               Login
                            </DropdownToggle>
                            <DropdownMenu right>
                                <DropdownItem>
                                    Login
                                </DropdownItem>
                                <DropdownItem>
                                    Sign Up
                                </DropdownItem>
                                <DropdownItem>
                                    Logout
                                </DropdownItem>
                                <DropdownItem divider />
                                <DropdownItem>
                                    Reset
                                </DropdownItem>
                            </DropdownMenu>
                        </UncontrolledDropdown>
                    </Nav>
                </Collapse>
            </Navbar>
        </div>
    );
  }
}

export default App;
